        content: 'I. PENGENALAN\nMobiledo Yazilim Hizmetleri Limited Sirketi ("Kami," "kami" atau "kami") mengambil privasi anda dengan serius. Dasar Privasi ini ("Dasar Privasi") menerangkan dasar perlindungan data kami dan menerangkan jenis maklumat yang kami dapat memproses apabila anda memasang dan/atau menggunakan aplikasi perisian untuk peranti mudah alih ("aplikasi", "aplikasi kami") dan menerangkan bagaimana kami Dan beberapa syarikat yang kami bekerjasama semasa memproses maklumat itu.\nApabila kita merujuk kepada data peribadi (atau maklumat peribadi), kami bermaksud apa -apa maklumat mengenai apa -apa jenis yang berkaitan dengan orang semula jadi yang boleh dikenal pasti, secara langsung atau tidak langsung, khususnya dengan merujuk kepada data tersebut.\nIa adalah orang semulajadi yang boleh dikenal pasti secara langsung atau tidak langsung, khususnya dengan merujuk kepada nombor pengenalan atau satu atau lebih faktor yang khusus untuk status fizikal, fisiologi, mental, ekonomi, budaya atau sosialnya.\nDasar Privasi kami terpakai kepada semua pengguna, dan orang lain yang mengakses aplikasi ("Pengguna").\nUntuk tujuan GDPR, kami adalah pengawal data, melainkan dinyatakan sebaliknya.\nSila baca Dasar Privasi berikut, untuk maklumat mengenai cara maklumat peribadi anda boleh diproses, dengan teliti. Apabila anda menggunakan aplikasinya, anda telah mengakui bahawa anda telah membaca, difahami, dan bersetuju untuk terikat dengan Terma ini.\n\nIi. Maklumat yang kami proses\nTerdapat dua kategori umum maklumat yang boleh kita proses.\nII.1 Maklumat yang anda serahkan\nKami memproses maklumat peribadi berikut mengenai anda apabila anda menggunakan aplikasinya. Maklumat ini diperlukan untuk prestasi kontrak yang mencukupi antara anda dan kami. Tanpa maklumat sedemikian, adalah mustahil untuk menyediakan fungsi lengkap aplikasinya dan melaksanakan perkhidmatan yang diminta.\nMaklumat lain yang berkaitan secara langsung dengan penggunaan aplikasi anda, seperti foto dan dokumen yang anda muat naik ke aplikasinya. Setelah persetujuan anda, kami juga mungkin mempunyai akses kepada roll kamera anda.\nIi.2 Maklumat yang diproses secara automatik\nApabila anda menggunakan aplikasinya, beberapa maklumat mengenai peranti anda dan tingkah laku pengguna anda boleh diproses secara automatik. Maklumat ini biasanya bukan peribadi, iaitu tidak, dengan sendiri, membenarkan persatuan langsung dengan mana-mana individu tertentu, dan kami hanya dapat mengaksesnya dalam bentuk agregat. Kami memproses maklumat ini atas dasar kepentingan sah kami dalam meningkatkan aplikasi kami dan memberi pengguna pengalaman terbaik kami. Jika kami tidak mengakses data tersebut, kami mungkin tidak dapat memberikan anda semua perkhidmatan dan ciri -ciri yang diminta.\nKami menggunakan teknologi pemprosesan data automatik pihak ketiga untuk menganalisis maklumat tertentu yang dihantar oleh peranti anda atau aplikasi kami. Teknologi pemprosesan data automatik (alat pengiklanan atau analisis) memberikan kami data yang diterangkan di bawah. Kami tidak mengawal, menyelia atau bertindak balas bagaimana pihak ketiga memproses data peribadi anda, yang mungkin dikumpulkan dengan cara mereka sendiri (bukan melalui aplikasi kami). Oleh kerana beberapa pihak ketiga kami mengisytiharkan pengawal diri mereka untuk tujuan GDPR, sebarang permintaan maklumat mengenai data peribadi anda harus diarahkan kepada pihak ketiga tersebut.\nMaklumat fail log. Maklumat fail log dilaporkan secara automatik setiap kali anda membuat permintaan untuk mengakses aplikasinya. Ia juga boleh disediakan apabila aplikasi dipasang pada peranti anda. Apabila anda menggunakan aplikasi kami, alat analisis secara automatik merekodkan maklumat fail log tertentu, termasuk masa dan tarikh apabila anda memulakan dan berhenti menggunakan aplikasinya, dan bagaimana anda berinteraksi dengan aplikasinya. Aplikasi ini boleh menggunakan pemprosesan automatik data peribadi anda, termasuk profil, yang bermaksud apa -apa bentuk pemprosesan automatik data peribadi yang digunakan untuk menilai aspek peribadi tertentu yang berkaitan dengan anda, khususnya untuk menganalisis atau meramalkan aspek mengenai keutamaan peribadi anda, minat, tingkah laku, lokasi atau pergerakan. Memproses maklumat melalui teknologi pemprosesan data automatik bermula secara automatik apabila anda mula menggunakan aplikasinya.\nKuki dan teknologi yang serupa. Apabila anda menggunakan aplikasinya, kami boleh menggunakan kuki dan teknologi yang serupa seperti piksel, suar web, skrip untuk memproses maklumat tentang bagaimana anda menggunakan aplikasi kami dan menyediakan ciri -ciri kepada anda. Kuki adalah fail teks yang mengandungi sejumlah kecil maklumat, yang dimuat turun ke peranti anda apabila anda mengakses aplikasinya. Fail teks kemudian dihantar kembali ke pelayan kami setiap kali anda menggunakan aplikasinya. Ini membolehkan kami mengendalikan aplikasi dengan lebih berkesan. Kami menggunakan maklumat agregat ini untuk memahami dan mengoptimumkan bagaimana aplikasi kami digunakan, meningkatkan usaha pemasaran kami, dan menyediakan kandungan dan ciri -ciri yang menarik minat anda. Kami mungkin meminta pengiklan atau rakan kongsi lain untuk melayani iklan atau perkhidmatan ke aplikasi, yang mungkin menggunakan kuki atau teknologi yang serupa.\n\nIii. Tujuan memproses data peribadi anda\nMisi kami adalah untuk sentiasa meningkatkan aplikasi kami dan memberi anda pengalaman baru. Sebagai sebahagian daripada misi ini, kami menggunakan maklumat anda untuk tujuan berikut:\n(a) Untuk menjadikan perkhidmatan kami tersedia. Kami menggunakan maklumat yang anda serahkan dan maklumat yang diproses secara automatik untuk memberi anda WI'
